"CEuTLo3FU1A";}i:119;a:1:{s:12:"created_time";i:1599241423;}i:120;a:1:{s:7:"caption";s:1108:"Avusturya'da Hallstätter gölü kıyısındaki Hallstatt köyü benim için rüya gibi. İnsan oradayken bir masalın içinde hissediyor. Karlarla kaplıyken inanılmazdı, ağaçların renklendiği mevsimde de eminim bambaşkadır. Her şeyin dingin, inanılmaz huzurlu olduğu bu köye yolunuz  düşerse uğrayın demeyeceğim, mutlaka rotanızı buraya çevirin!

The village Hallstatt on Lake Hallstätter in Austria is a dream for me. One feels in the fairy tale when you are there. It was incredible when it was covered with snow, and I am sure it is completely different when in the summer. If you happen to come to this village where everything is calm and incredibly peaceful, I will not say stop by, you must turn your route here! 

